(function(){
    var i,
        internal = stm_document, //исходящий документ
        registrars = edsGlobalSettings.getRegistrars("DA_REGISTRAR", internal),//получение списка регистраторов по документу
        registrarsCount = registrars.length;

var recipients = [];
